initState = "abcdefghijklmnop"

data Op = Spin Int
        | Exchange Int Int
        | Partner Char Char

parseInput :: String -> [Op]
parseInput = map parseOp . splitOn ","
  where
    parseOp ('s':cs) = Spin (read cs)
    parseOp ('x':cs) =
      let xs = splitOn "/" cs & map read in
      Exchange (head xs) (xs!!1)
    parseOp ['p',a,'/',b] = Partner a b
    parseOp _ = error "invalid input"

rotate :: Int -> [a] -> [a]
rotate n xs = cycle xs & drop n & take (length xs)

swapElems :: Eq a => a -> a -> [a] -> [a]
swapElems a b = map (\c -> if c == a then b else if c == b then a else c)

execOp :: String -> Op -> String
execOp s (Spin n) = rotate (length s - n) s
execOp s (Exchange i j) = swapElems (s!!i) (s!!j) s
execOp s (Partner a b) = swapElems a b s

cycleLen :: [Op] -> Int
cycleLen ops = (iterate (flip (foldl execOp) ops) initState & tail & takeWhile (/= initState) & length) + 1

runBillionOps :: String -> [Op] -> String
runBillionOps s ops = concatMap (const ops) [1..rounds] & foldl execOp s
  where rounds = 1000000000 `rem` cycleLen ops

solveParts :: Int -> (String,String)
solveParts _ = (foldl execOp initState ops, runBillionOps initState ops)
  where ops = parseInput input

main = Aoc.timer solveParts
